import React ,{Component} from 'react';
import './Admin.css';

class Admin extends Component{
    render(){
        return(
            <div>
            <div className="container">
            <div id="one">
            h1
            </div>
            <div className="two">
            h2
            </div>
            <div className="three">
            h3
            </div>
            <div className="four">
            h4
            </div>
           </div>
            </div>
        );
    };
};

export default Admin;
